import React, { useEffect, useState} from 'react';
import { Link, useHistory } from 'react-router-dom';
import styled from 'styled-components';
import {Tab, Nav, Row, Col} from 'react-bootstrap'
import { useCycle } from "framer-motion";

//component
import Product_Carousel from '../components/Carousel'
import Resultats from '../components/SearchResult'


//images offre special
import pneu1_offre_special from '../assets/offre_special/ENERGY_SAVER.png'
import pneu2_offre_special from '../assets/offre_special/ENERGY_SAVER_HAXX.png'
import pneu3_offre_special from '../assets/offre_special/LATITUDE_ALPIN.png'
import pneu4_offre_special from '../assets/offre_special/PILOT_SPORT.png'
import pneu5_offre_special from '../assets/offre_special/PILOT_SPORT_3.png'

//images top ventes 
import pneu1_top_ventes from '../assets/top_vente/CONTI_SPORT_CONTACT_5_Continental.png'
import pneu2_top_ventes from '../assets/top_vente/ENERGY_SAVER_Michelin.png'
import pneu3_top_ventes from '../assets/top_vente/LATITUDE_ALPIN_Michelin.png'
import pneu4_top_ventes from '../assets/top_vente/STORMY_IRIS.jpg'
import pneu5_top_ventes from '../assets/top_vente/ZEON_4XS_Cooper.png'

//image vente budjet 
import pneu1_vente_budjet from '../assets/vente_budjet/CONTI_PREMIUM_CONTACT_6_Continental.png'
import pneu2_vente_budjet from '../assets/vente_budjet/CROSSCLIMATEHAXX_Michelin.png'
import pneu3_vente_budjet from '../assets/vente_budjet/DUELER_H_T_684_II_Bridgistone.png'
import pneu4_vente_budjet from '../assets/vente_budjet/PILOT_SPORT_4_Michelin.png'
import pneu5_vente_budjet from '../assets/vente_budjet/SCORPION_VERDE_ALL_SEASON_Pireli.png'


const Styles = styled.div`
background:#fff;
grid-template: repeat(2, [row] 1fr) / repeat(14, [col] 1fr);

.recommandation{
  grid-column: col 2 / span 12;
  grid-row: row 1 / span 2;
  background:transparent;
  border-top: 3px solid #6E7888;
  margin:0 7%;
}
.section1{
   padding: 0 2%;
   height:auto;
}
.section-row{
    display:flex;
    flex-direction:row;
    justify-content:center;
    align-items:center;
    margin:5% 0;
    height:30%
}
.text-presentatif{
    height:100%;
    width:50%;
    padding:0 5%;
}
.product-slider{
    display:flex;
    flex-direction:row;
    justify-content:center;
    align-items:center;
    height:100%;
    width:50%;
}
.titre{
    font-size:4em;
    font-weight:bold;
    color:rgba(199, 7, 7, 0.85)
}
.recommandation-content{
    display:flex;
    flex-direction:row;
    justify-content:center;
    align-items:center;
    width: 100%;
    margin-bottom:10%;
}
.card-rec{
    display:flex;
    flex-direction:column;
    justify-content:flex-start;
    align-items:flex-start;
    width:33%;
}
.name{
   font-size:1em;
   font-weight:bold;
   color:#666;
   margin:0;
   padding:0;
}
.marque{
    font-size:1em;
   font-weight:bold;
   color:#333;
   margin:0;
   padding:0;
}
.prix{
    font-size:1.2em;
   font-weight:bold;
   color:#555;
   margin:0;
   padding:0;
}
.carousel-button{
    width:50%;
    height:30%;
    padding:1% 1%;
    background : #EF1A23;
    border:none;
    color:white;
    font-size:1.2em;
    font-weight:bold;
}
.marques{
    padding:0 7%;
    margin: 5% 0;
}
.titre-marques{
    font-size:2em;
    font-weight:600;
    color:#555;
    font-family: 'Teko', sans-serif;
}

`;

function Home(props) {
    let history = useHistory()
    const [Resultat, setResultat] = useState([])

    const offre_speciale_content =[
        {
            image : pneu1_offre_special,
            name : 'ENERGY SAVER',
            marque : 'Michelin',
            prix : '2560.00 Dz'
        },
        {
            image : pneu2_offre_special,
            name : 'ENERGY SAVER HAXX',
            marque : 'Michelin',
            prix : '2560.00 Dz'
        },
        {
            image : pneu3_offre_special,
            name : 'LATITUDE_ALPIN',
            marque : 'Michelin',
            prix : '2560.00 Dz'
        },
        {
            image : pneu4_offre_special,
            name : 'PILOT SPORT',
            marque : 'Michelin',
            prix : '2560.00 Dz'
        },
        {
            image : pneu5_offre_special,
            name : 'PILOT SPORT 3',
            marque : 'Michelin',
            prix : '2560.00 Dz'
        }
    ]

    const top_ventes_content =[
        {
            image : pneu1_top_ventes,
            name : 'CONTI SPORT CONTACT 5',
            marque : 'Continental',
            prix : '2560.00 Dz'
        },
        {
            image : pneu2_top_ventes,
            name : 'ENERGY SAVER',
            marque : 'Michelin',
            prix : '2560.00 Dz'
        },
        {
            image : pneu3_top_ventes,
            name : 'LATITUDE ALPIN',
            marque : 'Michelin',
            prix : '2560.00 Dz'
        },
        {
            image : pneu4_top_ventes,
            name : 'STORMY',
            marque : 'IRIS',
            prix : '2560.00 Dz'
        },
        {
            image : pneu5_top_ventes,
            name : 'ZEON 4XS',
            marque : 'Cooper',
            prix : '2560.00 Dz'
        }
    ]

    const vente_budjet_content =[
        {
            image : pneu1_vente_budjet,
            name : 'CONTI PREMIUM CONTACT 6',
            marque : 'Continental',
            prix : '2560.00 Dz'
        },
        {
            image : pneu2_vente_budjet,
            name : 'CROSSCLIMATEHAXX',
            marque : 'Michelin',
            prix : '2560.00 Dz'
        },
        {
            image : pneu3_vente_budjet,
            name : 'DUELER H T 684 II',
            marque : 'Continental',
            prix : '2560.00 Dz'
        },
        {
            image : pneu4_vente_budjet,
            name : 'PILOT SPORT',
            marque : 'Michelin',
            prix : '2560.00 Dz'
        },
        {
            image : pneu5_vente_budjet,
            name : 'SCORPION VERDE ALL SEASON',
            marque : 'Pireli',
            prix : '2560.00 Dz'
        }
    ]
     
    const [key, setKey] = useState("offreSpecial");
    const ActiveStyle = {
        textAlign: "center",
        background: "transparent",
        color: "#FB3C29",
        fontWeight:'700',
        fontSize:'2em',
        borderTop: "5px solid #6E7888",
        fontFamily:'Teko, sans-serif ' 

    };
    const inActiveStyle = {
        ...ActiveStyle,
        background: "transparent",
        color: "#6E7888",
        fontWeight:'700',
        fontSize:'2em',
        borderTop:'none',
        paddingTop:'3px',
        fontFamily:'Teko, sans-serif ' 
    };

    useEffect(() => {
        props.setNavigation(history.location.pathname)
        setResultat(JSON.parse(localStorage.getItem('searchResult')))
      }, []);
    return(
        <React.Fragment>
            <Styles>
                <div className='recommandation'>
            <Tab.Container 
                id="controlled-tab-example" 
                defaultActiveKey={key}
                activeKey={key} 
                onSelect={key => setKey(key)}>
                            <Row >
                                <Col>
                                    <Nav.Link  
                                    eventKey="offreSpecial" 
                                    style={key === "offreSpecial" ? ActiveStyle : inActiveStyle}
                                    >
                                        Offre speciale
                                    </Nav.Link>
                                </Col>
                                <Col>
                                    <Nav.Link  
                                    eventKey="topVente" 
                                    style={key === "topVente" ? ActiveStyle : inActiveStyle}
                                    >
                                        Top Vente
                                    </Nav.Link>
                                </Col>
                                <Col>
                                    <Nav.Link  
                                    eventKey="venteBudjet" 
                                    style={key === "venteBudjet" ? ActiveStyle : inActiveStyle}
                                    >
                                        Pneus Budget
                                    </Nav.Link>
                                </Col>
                            </Row>
                            <Tab.Content>
                                <Tab.Pane eventKey="offreSpecial" >
                                    <div className='recommandation-content'>
                                        <div className='card-rec'>
                                            <img
                                                src={offre_speciale_content[0].image}
                                                alt="Logo Pneu service"
                                            />
                                            <p className='name'>{offre_speciale_content[0].name}</p>
                                            <p className='marque'>{offre_speciale_content[0].marque}</p>
                                            <p className='prix'>{offre_speciale_content[0].prix}</p>
                                            <button className='carousel-button' type='button'>Voir</button>
                                        </div>
                                        <div className='card-rec'>
                                        <img
                                                src={offre_speciale_content[1].image}
                                                alt="Logo Pneu service"
                                            />
                                            <p className='name'>{offre_speciale_content[1].name}</p>
                                            <p className='marque'>{offre_speciale_content[1].marque}</p>
                                            <p className='prix'>{offre_speciale_content[1].prix}</p>
                                            <button className='carousel-button' type='button'>Voir</button>

                                        </div>
                                        <div className='card-rec'>
                                        <img
                                                src={offre_speciale_content[2].image}
                                                alt="Logo Pneu service"
                                            />
                                            <p className='name'>{offre_speciale_content[2].name}</p>
                                            <p className='marque'>{offre_speciale_content[2].marque}</p>
                                            <p className='prix'>{offre_speciale_content[2].prix}</p>
                                            <button className='carousel-button' type='button'>Voir</button>

                                        </div>
                                        <div className='card-rec'>
                                        <img
                                                src={offre_speciale_content[3].image}
